module test;
  reg nsR, npR;
  reg clk1;
  reg clk2;
 // wire clk1;
 // wire clk2;
  reg reset;
  reg [ 9 : 0 ] a;
  reg [ 9 : 0 ] b;
  wire [ 9 : 0 ] out;

  mul_add #( 10, 0 )dut (
    .clk1 ( clk1 ),
    .clk2 ( clk2 ),
    .reset ( reset ),
    .a ( a ),
    .b ( b ),
    .out ( out )
  );


  initial begin
     $prsim("clock.prs");

     $to_prsim ("nsR", "g._sReset");
     $to_prsim ("npR", "g._pReset");
     $from_prsim( "L1.a", "clk1" );
     $from_prsim( "L2.a", "clk2" );

  end

  initial begin
//    clk1 = 0;
//    clk2 = 0;
    nsR = 0;
    #90 npR = 1;
    #90 npR = 0;
    #90 npR = 1;
    #90 nsR <= 1;
    #30 reset = 1;
    #100 reset = 0;
    a = 1; // 1 unit b4 first posedge
    b = 2;
    #120 a = 3;
    b =10;
    #120 a = 10;
    b = 1;
    #120 a = 2;
    b = 12;
    #120 a = 5;
    b = 13;
    #360 $finish;  
  end 

  initial begin
    $dumpfile("mul_add.vcd");
    $dumpvars;
  end

  initial begin
    $display("\t\ttime,\treset,\tclk1,\tclk2,\ta,\tb,\t\out");
    $monitor("%d,\t%b,\t%b,\t%d,\t%d,\t%d",$time,reset,clk1,clk2,a,b,out);
  end


endmodule 
